import React from 'react';
import styled from "styled-components";
import {SectionTitle} from "../../../components/ScetionTitle";
import {Menu} from "../../../components/menu/Menu";
import {FlexWrapper} from '../../../components/FlexWrapper';
import {Work} from "./work/Work";
import socialImg from '../../../assets/img/Portfolio.png'
import {Container} from "../../../components/Container";

const workItems = ['ALL', 'LANDING PAGE', 'REACT', 'SPA',]


export const Works = () => {
    return (
        <StyledWork>
            <SectionTitle>Works</SectionTitle>
            <Container>
                <Menu menuItems={workItems}/>
                <FlexWrapper justify={'space-around'}>
                    <Work title={'Social Network'} src={socialImg} text={'My First project'}/>
                </FlexWrapper>
            </Container>
        </StyledWork>
    );
};

const StyledWork = styled.section`
  background-color: darkgrey;
`
